import React, {useState} from "react";

const App = () => {
const [count,setCount]=useState(0)

    return(
        <div>
            <button onClick={()=>setCount(count+1)}>
                click Me
            </button>
            <h2>
                count : {count}
            </h2>
        </div>
    )


}

export default App
